import React from "react";

import { CarouselCardContainer, ImageCarousel } from "./carousel-card.styles";

const CarouselCard = ({ image }) => {
  return (
    <div>
      <h3>HOLAddddddddddddddd</h3>
      <CarouselCardContainer className="carousel__card">
        <ImageCarousel src={image} alt="" />
      </CarouselCardContainer>
    </div>
  );
};

export default CarouselCard;
